values:
&nbsp;I pretty much stopped writing in this thing a while ago. I started doing it in an attempt to keep up with high school friends but they have long abandoned their journals too.&nbsp; I guess since I last left all of you I have since graduated from Lehigh with a BS in molecular biology, then had to move out of my house in Bethlehem the next day (I felt rushed).&nbsp; As a side note I may get another degree in Earth and Enviromental Science in January or next May since I was one class short of getting it this Sept. I then went on Lehigh Field Camp where I was in the Rocky Mountains for a month in my wonderful tent.&nbsp; The entire trip was great even the parts that were really cold and didn't get above freezing.&nbsp; Though the whole trip brought to mind 3 things: sceens from Cannibal the Musical, Heavyweights, and the Oregon Trail.&nbsp;

After such an amazing experience I had to come back to my house in Aston which I am still getting used to.&nbsp; I'm so bored right now that I may have to resort to setting things on fire as a source of entertainment.&nbsp; I should be at least trying to amuse myself but I went broke after paying off my Health Care Loan and now I can't afford to do anything besides sit around the house and eat my parent's food.&nbsp;

Soon I will be moving into my new appartment in New Jersey (eww).&nbsp; I'll be going to grad school at Princeton starting September 8th and will be a slave there for the next 5 years.&nbsp; Some people criticize my use of the word slave since I will be getting 27K a year which is high as far as Molecular biology programs go, yet the cost of living in central new jersey is extream.&nbsp;

Maybe I should go watch more TV and eat more of my parent's food. This journal entry is probably just a cry for help.

I haven't posted in a while but I have been pretty busy and I guess I didn't feel like typing everything out.

I moved into my apartment in Philly for my internship at Penn in the beginning of June. Its a nice place for just me but it does get pretty quiet in here without a roomate.&nbsp; At least I have two beds so if anyone wants to visit me you will have a nice place to sleep.

Work isn't exactly the most exciting thing ever but I like it.&nbsp; I wish I had more independence though. I have a project but most of the time my supervisor works on it and I watch. Or he tells me to do his bitch work while he does the project. Bitch work is ok but I I would like it better if I was the bitch all the time or never. I don't like this sometimes stuff.&nbsp; The project in short is trying to get cancer cells to explode by adding a peptide to them. (if you want more details ask).&nbsp; 

I feel kind of ripped off that I work really long hours and most of the other interns I met don't.&nbsp; If I was getting paid by the hour this would be great but I get the same amount of money if I work 2 hours a week or 60.

At least our program coordinator is arranging fun stuff for us.&nbsp; On Wednesday we went to see the Philadelphia Orchestra and we are going to a Phillies game soon.

Penn is a very different place from Lehigh.&nbsp; Lehigh seems so small to me now but thats ok.&nbsp; I truely realized the size of Penn when I went to the cell center yesterday. It was like an underground city of biology with superlabs and hundreds of people.&nbsp; This one "center" is only a small fraction of biology at Penn but it was bigger then Lehigh's entire department.&nbsp;
